import {
  LineOne,
  LineThree,
  LineTwo,
  Logo,
  MenuIcon,
  Nav,
} from "../styles/layout/Nav.styled";

export const NavBar = () => {
  return (
    <>
      <Nav>
        <div>
          <a href="#hero-section">
            <Logo src="./images/logo.png" />
          </a>
        </div>
        <MenuIcon>
          <LineOne />
          <LineTwo />
          <LineThree />
        </MenuIcon>
        <div>Nav List</div>
      </Nav>
    </>
  );
};
